import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import {
    FaGraduationCap, FaDna, FaLandmark, FaLeaf,
    FaAtom, FaChartLine, FaPalette, FaRunning,
    FaMicrochip, FaHeartbeat, FaGlobeAmericas
} from 'react-icons/fa';

const iconMap = {
    'education': <FaGraduationCap />,
    'physical-life-sciences': <FaDna />,
    'social-science-humanities': <FaLandmark />,
    'agriculture-food-sciences': <FaLeaf />,
    'interdisciplinary-emerging-fields': <FaAtom />,
    'mathematics-data-science': <FaChartLine />,
    'arts-culture-communication': <FaPalette />,
    'sports-physical-education': <FaRunning />,
    'engineering-technology': <FaMicrochip />,
    'health-medical-sciences': <FaHeartbeat />,
    'business-economics': <FaGlobeAmericas />
};

const colorMap = {
    'business-economics': '#0ea5e9', // Sky Blue
    'health-medical-sciences': '#ef4444', // Red
    'engineering-technology': '#f59e0b', // Amber
    'education': '#3b82f6', // Royal Blue
    'physical-life-sciences': '#10b981', // Emerald
    'social-science-humanities': '#8b5cf6', // Violet
    'agriculture-food-sciences': '#84cc16', // Lime
    'interdisciplinary-emerging-fields': '#ec4899', // Pink
    'mathematics-data-science': '#6366f1', // Indigo
    'arts-culture-communication': '#f97316', // Orange
    'sports-physical-education': '#14b8a6', // Teal
};

const CategoryCard = ({ id, title, events = [] }) => {
    const icon = iconMap[id] || <FaAtom />;
    const themeColor = colorMap[id] || '#2563eb';

    return (
        <Link to={`/conferences/${id}`} className="category-card-link">
            <motion.div
                className="category-block"
                whileHover={{ y: -10, scale: 1.02 }}
                initial={{ opacity: 0, y: 30 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5, ease: "easeOut" }}
                style={{
                    background: `linear-gradient(145deg, #ffffff 0%, ${themeColor}15 100%)`, // Stronger tint
                    boxShadow: `0 20px 40px -15px ${themeColor}30`,
                    position: 'relative',
                    overflow: 'hidden'
                }}
            >
                {/* Decorative Glow Blob */}
                <div
                    style={{
                        position: 'absolute',
                        top: '-20px',
                        right: '-20px',
                        width: '120px',
                        height: '120px',
                        borderRadius: '50%',
                        background: themeColor,
                        opacity: '0.1',
                        filter: 'blur(40px)',
                        zIndex: 0
                    }}
                />

                <div className="category-content-wrapper" style={{ height: '100%', display: 'flex', flexDirection: 'column', position: 'relative', zIndex: 1 }}>

                    {/* Floating Icon Bubble */}
                    <div
                        className="category-icon-wrapper"
                        style={{
                            color: themeColor,
                            backgroundColor: 'rgba(255,255,255,0.8)', // White glass backing
                            border: `1px solid ${themeColor}20`,
                            width: '64px',
                            height: '64px',
                            borderRadius: '20px',
                            display: 'flex',
                            alignItems: 'center',
                            justifyContent: 'center',
                            fontSize: '1.75rem',
                            marginBottom: '1.5rem',
                            boxShadow: `0 8px 16px -4px ${themeColor}20`
                        }}
                    >
                        {icon}
                    </div>

                    <div style={{ flex: 1 }}>
                        <h3 className="category-block-title" style={{
                            color: '#1e293b',
                            fontSize: '1.35rem',
                            fontWeight: '700',
                            marginBottom: '0.5rem',
                            lineHeight: '1.3'
                        }}>
                            {title}
                        </h3>
                        <p style={{ color: '#64748b', fontSize: '0.95rem', fontWeight: '500' }}>
                            World-class events
                        </p>
                    </div>

                    <div className="category-meta" style={{
                        marginTop: '2rem',
                        display: 'flex',
                        alignItems: 'center',
                        justifyContent: 'space-between',
                        borderTop: `1px solid ${themeColor}15`,
                        paddingTop: '1.25rem'
                    }}>
                        <span
                            className="category-count"
                            style={{
                                color: themeColor,
                                fontWeight: '600',
                                background: `${themeColor}08`, // Pill style
                                padding: '0.4rem 0.85rem',
                                borderRadius: '99px',
                                fontSize: '0.85rem'
                            }}
                        >
                            {events.length} Events
                        </span>

                        <motion.div
                            className="category-action"
                            style={{ color: themeColor, display: 'flex', alignItems: 'center', gap: '6px', fontWeight: '600' }}
                            whileHover={{ x: 3 }}
                        >
                            <span>Explore</span>
                            <svg width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2.5" strokeLinecap="round" strokeLinejoin="round">
                                <path d="M5 12h14M12 5l7 7-7 7" />
                            </svg>
                        </motion.div>
                    </div>
                </div>
            </motion.div>
        </Link>
    );
};

export default CategoryCard;
